function findCities(val,cityId,countyId)
{
	$("#"+cityId).html("<option value='' >请选择</option>")
	$("#"+countyId).html("<option value='' >请选择</option>")
	$(cities).each(function(){
		if(this.parent==val)
		{
			var html="";
			html +="<option value='' >请选择</option>";
			$(this.list).each(function(){
				html +="<option value='"+this.id+"' >"+this.name+"</option>";
			});
			$("#"+cityId).html(html)
		}
	})
}

function setAddress(valueArray, idArray) {
	provinceValue = valueArray[0];
	cityValue = valueArray[1];
	countyValue = valueArray[2];
	
	provinceId = idArray[0];
	cityId = idArray[1];
	countyId = idArray[2];
	
	$(provinceId).val(provinceValue);
	$(cityId).val(cityValue);
	findCounties(cityValue, "county");
	$(countyId).val(countyValue);
}

function findCounties(val,countyId)
